                    <h1 class="page-title">PROGRAM OUTCOMES</h1>
                    <div class="clearfix"></div>
                    <p>
                        <strong> Engineering knowledge:</strong> Apply the knowledge of mathematics, science,
                        engineering fundamentals, and an engineering specialization to the solution of complex
                        engineering problems. <br><br>
                        <strong>Problem analysis:</strong> Identify, formulate, review research literature, and analyze
                        complex engineering problems reaching substantiated conclusions using first principles of
                        mathematics, natural sciences, and engineering sciences. <br><br>
                        <strong>Design/development of solutions:</strong> Design solutions for complex engineering
                        problems and design system components or processes that meet the specified needs with
                        appropriate consideration for the public health and safety, and the cultural, societal, and
                        environmental considerations. <br><br>
                        <strong>Conduct investigations of complex problems:</strong> Use research-based knowledge and
                        research methods including design of experiments, analysis and interpretation of data, and
                        synthesis of the information to provide valid conclusions. <br><br>
                        <strong>Modern tool usage:</strong> Create, select, and apply appropriate techniques, resources,
                        and modern engineering and IT tools including prediction and modeling to complex engineering
                        activities with an understanding of the limitations. <br><br>
                        <strong>The engineer and society:</strong> Apply reasoning informed by the contextual knowledge
                        to assess societal, health, safety, legal and cultural issues and the consequent
                        responsibilities relevant to the professional engineering practice. <br><br>
                        <strong>Environment and sustainability:</strong> Understand the impact of the professional
                        engineering solutions in societal and environmental contexts, and demonstrate the knowledge of,
                        and need for sustainable development. <br><br>
                        <strong>Ethics:</strong> Apply ethical principles and commit to professional ethics and
                        responsibilities and norms of the engineering practice. <br><br>
                        <strong>Individual and team work:</strong> Function effectively as an individual, and as a
                        member or leader in diverse teams, and in multidisciplinary settings. <br><br>
                        <strong>Communication:</strong> Communicate effectively on complex engineering activities with
                        the engineering community and with society at large, such as, being able to comprehend and write
                        effective reports and design documentation, make effective presentations, and give and receive
                        clear instructions. <br><br>
                        <strong>Project management and finance:</strong>Demonstrate knowledge and understanding of the
                        engineering and management principles and apply these to oneâ€™s own work, as a member and leader
                        in a team, to manage projects and in multidisciplinary environments. <br><br>
                        <strong>Life-long learning:</strong> Recognize the need for, and have the preparation and
                        ability to engage in independent and life-long learning in the broadest context of technological
                        change. <br><br>
                    </p>
                    <p>
                        <strong class="strong-title">PROGRAM SPECIFIC OUTCOMES (PSOs) </strong>
                    </p>
                    <p>A graduate of the Computer Science and Engineering Program will demonstrate</p>
                    <ul>
                        <li><strong>Foundation Skills: </strong>Ability to understand, analyze and develop computer
                            programs in the areas related to algorithms, system software, web design, machine learning,
                            data analytics, and networking for efficient design of computer-based systems of varying
                            complexity. Familiarity and practical competence with a broad range of programming language
                            and open source platforms.</li>
                        <li><strong>Problem-Solving Skills: </strong>Ability to apply mathematical methodologies to
                            solve computational task, model real world problem using appropriate data structure and
                            suitable algorithm. To understand the Standard practices and strategies in software project
                            development using open-ended programming environments to deliver a quality product.</li>
                        <li><strong>Successful Progression: </strong>Ability to apply knowledge in various domains to
                            identify research gaps and to provide solution to new ideas, inculcate passion towards
                            higher studies, creating innovative career paths to be an entrepreneur and evolve as an
                            ethically social responsible computer science professional.</li>
                    </ul>
                </div>
                <div id="opportunities" class="main-content" style="display: none;">
                    <!-- Content for Opportunities -->
                    <h1 class="page-title">Opportunities</h1>
                    <p>
                        Computer science and engineering graduates are the pillars of the current and emerging
                        information era. Opportunities include pursuing Master of Science Programs in reputed
                        Universities of U.S and Europe. and taking up research assignments in Hardware, System Software,
                        Computer Engineering, Multimedia, Networking and Communication areas.
                        <br /><br />
                        Computer science is a broad field with many different job paths to choose from. With so many
                        options, it can be difficult to decide on a certain route to study and focus on. Even if
                        mastering only one specific subject of interest in Computer Science is possible, it is necessary
                        to acquire all of the fundamentals connected to other areas in order to implement and use that
                        subject of interest. For example, when writing Server-side scripts, we must know how to obtain
                        data from databases and/or perform HTTP requests to retrieve information/outputs from APIs, in
                        addition to dealing with the Frontend elements and delivering accordingly. So, in order to use
                        databases and retrieve data via APIs, we must first understand the fundamental ideas and
                        applications.
                        <br>Job opportunities are ever increasing and are varied in nature. System study, analysis,
                        Design and Programming are the inherent phases in Application Development and each one of them
                        provides enormous potential to the Computer Science and engineering graduates to shape their
                        careers. Hi-end profiles include Machine Learning, Data Science, Artificial Intelligence,
                        Robotics, Graphic Solutions and Simulations, Mobile Application Development, Automation etc.,
                        The doors of companies are always open for Software Developer, Full Stack Software Developer,
                        Data Analyst ,Data Scientist, Database Administrator, Cyber Security Specialist, Data Engineer,
                        Machine Learning Engineer etc., with a huge package.
                        <br /><br />
                        This degree program prepares students for Advanced Technical Computer Systems Design and
                        Development Work. It includes the study of basics with Data Science, Database Design, Data
                        Communications, Procedural and Object Oriented Programming, Operating Systems Design, Algorithm
                        Development and Applications of Artificial Intelligence. The curriculum includes basic course
                        work in Electronics Technology and the Theory of Programming Languages. Students focus on
                        developing computer-based solutions involving hardware and software components and integration.
                        Graduates are qualified to work in a range of positions, from entry-level computer scientists
                        and system engineers to project managers leading advanced applications of computer science to
                        real-world problems. The department has since broadened its research strengths.
                    </p>
                </div>
